class Solution2483 {
    companion object {
        private const val NO_CUSTOMER = 'N'
    }

    fun bestClosingTime(customers: String): Int {
        var curCost = 0
        var minCost = 0
        var hour = 0;

        for (i in customers.indices) {
            if (customers[i] == NO_CUSTOMER)
                curCost++
            else
                curCost--

            if (curCost < minCost) {
                hour = i + 1
                minCost = curCost
            }
        }

        return hour
    }
}

private const val e1 = "YYNY"
private const val e2 = "NNNNN"
private const val e3 = "YYYY"
private const val e4 =
    ""

fun main() {
    listOf(e1, e2, e3).forEach { println("$it -> ${Solution2483().bestClosingTime(it)}") }
    listOf(e4).forEach { println(Solution2483().bestClosingTime(it)) }
}
// 2
// 0
// 4
// 23300
